var title_f40_39_41587="Normal neuronal firing";
var content_f40_39_41587=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F74749&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F74749&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 607px\">",
"   <div class=\"ttl\">",
"    Normal neuronal firing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 587px; height: 305px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic of neuron with one excitatory (E) and one inhibitory (I) input. Right trace shows membrane potential (in millivolts, mV), beginning at a typical resting potential (-70 mV). Activation of E leads to graded excitatory post-synaptic potentials (EPSPs), the larger of which reaches threshold (approximately -40 mV) for an action potential. The action potential is followed by an after-hyperpolarization (AHP), the magnitude and duration of which determine when the next action potential can occur. Activation of I causes an inhibitory postsynaptic potential (IPSP). Inset (box) shows magnified portion of the neuronal membrane as a lipid bilayer with interposed voltage-gated Na+ and K+ channels; the direction of ion fluxes during excitatory activation is shown. After firing, the membrane-bound Na+ -K+ pump and star-shaped astroglial cells restore ionic balance.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stafstrom, CE. An introduction to seizures and epilepsy: cellular mechanisms underlying classification and treatment. In: Epilepsy and the Ketogenic Diet, Stafstrom, CE, Rho, JM (Eds), Humana Press, Totowa, New Jersey 2004. p.11. Copyright &copy; 2004 Springer-Verlag.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
