var script_f40_39_41596=[""].join("\n");
var outline_f40_39_41596=null;
var title_f40_39_41597="Carboplatin plus etoposide for small cell lung cancer";
var content_f40_39_41597=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F75586&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F75586&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Carboplatin plus etoposide for chemotherapy-na&iuml;ve extensive-stage small cell lung cancer",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 21 days, for a maximum of six cycles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Carboplatin",
"        </strong>",
"       </td>",
"       <td>",
"        AUC* = 5 mg/mL x min IV",
"       </td>",
"       <td>",
"        Dilute in 250 mL normal saline (NS)",
"        <sup>",
"         &Delta;",
"        </sup>",
"        and administer over 30 minutes.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Etoposide",
"        </strong>",
"       </td>",
"       <td>",
"        100 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute in 500 mL NS",
"        <sup>",
"         &Delta;",
"        </sup>",
"        or 5 percent dextrose in water (D5W) to final concentration &lt;0.4 mg/mL. Infuse over 30 to 60 minutes; if infused more rapidly, severe hypotension may occur.",
"       </td>",
"       <td>",
"        Days 1, 2, and 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        MODERATE on day 1 and LOW on days 2 and 3. Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Carboplatin and etoposide are irritants. Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Routine primary prophylaxis with hematopoietic growth factors is not recommended (incidence of febrile neutropenia is about 5 percent",
"        <sup>",
"         [1]",
"        </sup>",
"        ). Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        Each carboplatin dose should be calculated based upon renal function by use of the Calvert formula*. A lower starting dose of etoposide may be needed for patients with renal or liver impairment",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Electrolytes and liver and renal function prior to each cycle of chemotherapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Dose adjustment based on myelotoxicity was not reported in the final publication. Per protocol, cycles were delayed for up to 42 days to allow neutrophils to return to &ge;1500 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        and platelets to &ge;100,000/mm",
"        <sup>",
"         3[1]",
"        </sup>",
"        . However, the FDA-approved labeling recommends that the dose of carboplatin be reduced by 25 percent if platelets are &lt;50,000 /mm",
"        <sup>",
"         3",
"        </sup>",
"        and/or ANC is &lt;500 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Nonhematologic toxicity:",
"        </strong>",
"        Chemotherapy should be held for grade 3 and 4 nonhematologic toxicities (except for neurotoxicity) and is only restarted after the toxicity has resolved to patient's baseline",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hepatotoxicity:",
"        </strong>",
"        No formal etoposide dosing recommendations were reported in this publication. However, accepted dose reductions per product information may be found in the literature. Refer to UpToDate topic on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Nephrotoxicity:",
"        </strong>",
"        Alterations in renal function during therapy may require a recalculation of the carboplatin dose. Refer to UpToDate topic on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated for all drugs.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; CBC: complete blood count; ANC: absolute neutrophil count.",
"     <br/>",
"     * AUC (area under the concentration X time curve) is converted to a patient-specific carboplatin dose (in mg) according to renal function by using the Calvert formula. The Calvert formula is total dose (mg) = (target AUC) x (GFR + 25). If using measured serum creatinine, limit the maximal GFR for the calculation to 125 mL/min. Refer to UpToDate topic on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"     <br/>",
"     &Delta; Diluent solutions should not be modified without consulting a detailed reference due to potential incompatibility(ies).",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Socinski MA, et al. J Clin Oncol 2009; 27:4787.",
"      </li>",
"      <li>",
"       Toposar (etoposide) injection. US FDA-approved package insert US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 13, 2011).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
